import React from 'react';
import {Link} from 'react-router-dom';

const Navbar = () => {

	return (
		<nav className="mb-1 navbar navbar-expand-lg navbar-dark orange
		 lighten-1">
			<div className = "container">
				<a className="navbar-brand" href="#">
					<img src="Logo.svg" height="30" class="d-inline-block align-top"
     				 alt="spartan logo" /> <p style={{color:"0E69D3"}}>SpiritWorld </p>
					
				</a>
			</div>

		</nav>


	)
	
}

export default Navbar
